import React, {Component} from 'react';
import Layout from '../../../components/Layout';
import {Link} from '../../../routes';
import {Button} from 'semantic-ui-react';

class RequestIndex extends Component {
    render() {
        return(
            <Layout>
            <h3> Request List</h3>
            </Layout>
        );
    }
}

export default RequestIndex;
